import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import SignInSide from './component/SignInSide';
import Login from './routes/Login'; // Login sayfasını burada import edin

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Switch>
            <Route path="/login" component={Login} /> {/* /login rotası için Login bileşeni */}
            <Route path="/" exact>
              {/* Diğer içerik */}
            </Route>
          </Switch>
        </header>
      </div>
    </Router>
  );
}

export default App;
